/*

Given a string, find the length of the longest substring without repeating characters.

Examples:

Given "abcabcbb", the answer is "abc", which the length is 3.

Given "bbbbb", the answer is "b", with the length of 1.

Given "pwwkew", the answer is "wke", with the length of 3. Note that the answer must be a substring, "pwke" is a subsequence and not a substring.

https://leetcode.com/problems/longest-substring-without-repeating-characters/

*/

#include <stdio.h>
#include <string.h>
#include "gtest/gtest.h"

int lengthOfLongestSubstring(const char* s) {
    if (!s) {
        return 0;
    }

    int len = 0;
    int map[256];
    memset(map, -1, 256*sizeof(int));
    int j = 0;
    for (int i = 0; i < (int)strlen(s); ++i) {
        if (map[(int)s[i]] != -1) {
            j = j > map[(int)s[i]] ? j : map[(int)s[i]] + 1;
        }
        map[(int)s[i]] = i;
        len = len > (i - j + 1) ? len : (i - j + 1);
    }
    return len;
}
TEST(LongestSubstringWithoutRepeatingCharacters, test) {
    EXPECT_EQ(lengthOfLongestSubstring("dvdf"), 3);
    EXPECT_EQ(lengthOfLongestSubstring("ccde"), 3);
    EXPECT_EQ(lengthOfLongestSubstring("ccde"), 3);
}

